#Truucje: we moeten hieronder wel de losse tag brp:geslachtsnaam raken maar niet brp:geslachtsnaamcomponent(en)
brp:geslachtsnaamcomponenten      = brp:XYZgeslachtsnaamcomponenten
brp:geslachtsnaamcomponent        = brp:ABCgeslachtsnaamcomponent

########################
# Attributen & groepen #
########################
# Adres, geboorte, overlijden, relatie
brp:landCode                      = brp:landGebiedCode
brp:landAanvangCode               = brp:landGebiedAanvangCode
brp:landEindeCode                 = brp:landGebiedEindeCode
brp:landGeboorteCode              = brp:landGebiedGeboorteCode
brp:landOverlijdenCode            = brp:landGebiedOverlijdenCode
# Samengestelde naam
brp:indicatieAlgoritmischAfgeleid = brp:indicatieAfgeleid
brp:geslachtsnaam                 = brp:geslachtsnaamstam
brp:predikaatCode                 = brp:predicaatCode
# Adres
brp:adresseerbaarObject           = brp:identificatiecodeAdresseerbaarObject
brp:locatietovAdres               = brp:locatieTenOpzichteVanAdres
brp:locatieOmschrijving           = brp:locatieomschrijving
# Aanschrijving / naamgebruik
brp:aanschrijving                 = brp:naamgebruik
brp:naamgebruikCode               = brp:code
# Geslachtsnaamcomponent
# Slimme regex om alleen van toepassing te laten zijn op 'naam' binnen geslachtsnaamcomponenten,
# anders komt 'naam' binnen voornamen ook mee.
<brp:naam>(.*)</brp:naam>.*(\r)?\n.*</brp:ABCgeslachtsnaamcomponent> = <brp:stam>$1</brp:stam></brp:ABCgeslachtsnaamcomponent>
# indicaties
brp:verstrekkingsbeperking        = brp:volledigeVerstrekkingsbeperking
brp:belemmeringVerstrekkingReisdocument = brp:signaleringMetBetrekkingTotVerstrekkenReisdocument


#Truucje terugzetten (zie bovenaan)
brp:ABCgeslachtsnaamcomponent     = brp:geslachtsnaamcomponent
brp:XYZgeslachtsnaamcomponenten   = brp:geslachtsnaamcomponenten

####################
# Complexe renames #
####################

# Rename en andere betekenis (niet aangetroffen 'J' -> aangetroffen 'N', niet aangetroffen 'N' -> valt weg)
<brp:indicatiePersoonNietAangetroffenOpAdres>J</brp:indicatiePersoonNietAangetroffenOpAdres> = <brp:indicatiePersoonAangetroffenOpAdres>N</brp:indicatiePersoonAangetroffenOpAdres>


